import { En_Hero } from "../comps/Portal";
import { homeCharging } from "../constants";

const Home_Charging = () => {
  return (
    <>
      <En_Hero
        prod={homeCharging}
        title="Charging"
        subtitle="Go Anywhere, Charge Everywhere"
        customLinkLabel="Demo Drive"
        get="/"
      />
    </>
  );
};

export default Home_Charging;
